('CHARTBAR', 364, 443, 10, '', '    //그리드 조회({G.GRPNM})	\n    function {G.GRPID}_{G.FNCID}(tinput,token){\n        alog(\"{G.GRPID}_{G.FNCID}()------------start\");\n\n        //post 만들기\n		sendFormData = new FormData($(\"#condition\")[0]);\n		if(typeof tinput != \"undefined\"){\n			var tKeys = tinput.keys();\n			for(i=0;i<tKeys.length;i++) {\n				sendFormData.append(tKeys[i],tinput.get(tKeys[i]));\n				//console.log(tKeys[i]+ \'=\'+ tinput.get(tKeys[i])); \n			}\n		}\n\n\n        //불러오기\n        $.ajax({\n            type : \"POST\",\n            url : url_{G.GRPID}_{G.FNCID}+\"&TOKEN=\" + token ,\n            data : sendFormData,\n			processData: false,\n			contentType: false,\n            dataType: \"json\",\n            async: true,\n            success: function(resData){\n                alog(\"   gridSearch6 json return----------------------\");\n                alog(\"   json data : \" + resData);\n                alog(\"   json RTN_CD : \" + resData.RTN_CD);\n                alog(\"   json ERR_CD : \" + resData.ERR_CD);\n                //alog(\"   json RTN_MSG length : \" + resData.RTN_MSG.length);\n\n                //그리드에 데이터 반영\n                if(resData.RTN_CD == \"200\"){\n					var row_cnt = 0;\n					if(resData.RTN_DATA){\n						row_cnt = resData.RTN_DATA.rows.length;\n						$(\"#span{G.GRPID}Cnt\").text(row_cnt);\n\n\n\n\n', '', '', '', 'R', '', '', '20180515084422', '20190325220144'),
