('BIVIEW', 465, 580, 20, '', '	//post 만들기\n	sendFormData = new FormData($(\"#condition\")[0]);\n	if(typeof tinput != \"undefined\"){\n		var tKeys = tinput.keys();\n		for(i=0;i<tKeys.length;i++) {\n			sendFormData.append(tKeys[i],tinput.get(tKeys[i]));\n			//console.log(tKeys[i]+ \'=\'+ tinput.get(tKeys[i])); \n		}\n	}\n\n    $.ajax({\n        type : \"POST\",\n        url : url_{G.GRPID}_{F.FNCID}+\"&TOKEN=\" + token + \"&{G.GRPID}_CRUD_MODE=SEARCH\" ,\n        data : sendFormData,\n		processData: false,\n		contentType: false,\n        dataType: \"json\",\n        success: function(data){\n            alog(data);\n\n			if(data && data.RTN_CD == \"200\"){\n				if(data.RTN_DATA){\n					msgNotice(\"[{G.GRPNM}] 정상적으로 조회되었습니다.\",1);\n				}else{\n					msgNotice(\"[{G.GRPNM}] 정상적으로 조회되었으나 데이터가 없습니다.\",2);\n					return;\n				}\n			}else{\n				msgError(\"[{G.GRPNM}] 오류가 발생했습니다(\"+ data.ERR_CD + \").\" + data.RTN_MSG,3);\n				return;\n			}\n', '', '', '', 'R', '', '', '20190624231732', '20190712065540'),
