(260, 24, 75, 'sTeamChart', 'TEAM2', 5, 'R', 'RTN_SELECT_LIST', 0, 'select c.TEAM_NM, count(distinct b.type) as TYPE_CNT, ifnull(count(b.LOADD_SEQ),0) as VUL_CNT\nfrom \n	TEAMINFO c \n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere \ncase when #{G1-EX_TEAM_NM} <> \'\' then c.TEAM_NM <> #{G1-EX_TEAM_NM} \n	else\n		1=1\n	end\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc\n\n', NULL, '20181114075304', NULL),
